Generalizando a definição de pares, podemos descrever o tipo de listas de números assim: “Uma lista ou é a lista vazia ou então um conjunto de um elemento e outra Lista", esse tipo não é composto de um head e uma tail. type List (t) { nil cons (head: t) (tail: List t)
} Como vamos tratar de apenas um tipo, é interessante reescrever o tipo de lista para um definido, o escolhido foi o Nat : type NatList { nil cons (head: Nat) (tail: NatList)
} ou type NatList { List Nat
} Podemos perceber que em ambas as notações, há um head e um tail, sendo que o head recebe um elemento do tipo Nat e a tail recebe uma lista do tipo Nat . Por exemplo, uma lista de três números naturais 1n, 2n e 3n seria escrita da seguinte forma: [1n, 2n, 3n] O Kind, entretanto, lê de outra forma: [1n, [2n, 3n]] onde o 1n é a head e o [2n, 3n] é a tail. Da mesma forma, ao olhar para uma lista de 4 elementos [1n, 2n, 3n, 4n], agora veremos da seguinte forma: [1n, [2n, [3n, 4n]]] A lista possui o head 1n e a tail [2n, [3n, 4n]], que, por sua vez, possui a head 2n e a tail [3n, 4n] que também possui sua head 3n e sua tail 4n. Pode parecer assustador, mas é um monstro amigável: img [fonte da imagem: http://learnyouahaskell.com/starting-out]
